import axios from 'axios';
import React, { useState } from 'react';

function OpenAi() {
  const [images, setImages] = useState([]);

  const generateImages = () => {
    axios.post('/generate-images', { descriptions: ['просторы Казахстана', 'горные пейзажи', 'морские виды'] })
      .then(response => {
        setImages(response.data);
      })
      .catch(error => {
        console.log(error);
      });
  };

  return (
    <div>
      <button onClick={generateImages}>Сгенерировать картинки</button>
      {images.map((image, index) => (
        <img key={index} src={`data:image/jpeg;base64,${image}`} alt={`Generated Image ${index}`} />
      ))}
    </div>
  );
}

export default OpenAi;
